import React from 'react';
import axios from 'axios';

import { useState } from 'react'

export default function OrderForm() {
    const [orderNumber, setOrderNumber] = useState('');

    const handleSubmit = async (e) => {

        e.preventDefault();

        try {
          // Send the query data to the backend
          const response = await axios.get('/api/orderNumber', {
            params: {
                orderNumber
            }
          });
          console.log('Query saved successfully:', response.data);
        } catch (error) {
          console.error('Error saving query:', error);
        }
      };


    const handleChange = (e) => {

        setOrderNumber(e.target.value)
    }


    return (
        <div>
            <form onSubmit={handleSubmit}>
                <label>
                    orderNumber:
                    <input type="text" value={orderNumber} onChange={handleChange} placeholder="ORDER_NUMBER" />
                    <button type="submit">SUBMIT</button>
                </label>


            </form>


        </div>
    )

}
